import { Link } from 'react-router-dom';

function Navbar () {
    return (
        <>
            <div>
                <Link to={"/"}>BearWear</Link>
                <nav className="text-2xl active">BearWear</nav>
                <div className="text-right">
                    <a>User</a>
                </div>
            </div>

        </>

    );
};

export default Navbar;
